## 题目描述

输入一个字符串，判断其是否为回文字符串。回文字符串是指正反两个字符组成的字符串。

**示例 1：**

```
输入："A man, a plan, a canal: Panama"
输出：true
```

**示例 2：**

```
输入："race a car"
输出：false
```

**说明：**

- 字符串长度不超过100。
- 字符串中只含有小写字母。

## 解法

回文字符串的特点是：

- 字符串中只含有一个字符。
- 字符串中只含有大写字母。
- 字符串中只含有小写字母。

因此我们可以用一个变量来表示回文字符串的状态，如果字符串中只含有一个字符，则状态为0，如果字符串中只含有大写字母，则状态为1，如果字符串中只含有小写字母，则状态为2。

```java
/**
 * @param str 字符串
 * @return 是否为回文字符串
 */
public boolean isPalindrome(String str) {
    int len = str.length();
    if (len == 0) {
        return true;
    }
    int state = 0;
    for (int i = 0; i < len; i++) {
        if (state == 0) {
            if (str.charAt(i)!= str.charAt(len - i - 1)) {
                return false;
            }
            state = 1;
        } else if (state == 1) {
            if (str.charAt(i)!= str.charAt(len - i - 1)) {
                return false;
            }
            state = 2;
        } else if (state == 2) {
            state = 0;
        }
    }
    return true;
}
```

