## 题目描述

输入一个整数数组，判断该数组是不是某二叉搜索树的后序遍历结果。如果是则输出Yes,否则输出No。假设输入的数组的任意两个数字都互不相同。

## 解法一

### 解法分析

每个节点都有左右子树，所以每个节点都有左右子树的后序遍历结果，所以可以利用递归的思想，对于每个节点，递归的调用`is_post_order`，判断该节点是否是后序遍历结果。

```java
/**
 * @param {number[]} nums
 * @return {boolean}
 */
public boolean verifyPostorder(int[] nums) {
    if (nums == null || nums.length == 0) {
        return true;
    }
    return is_post_order(nums, 0, nums.length - 1);
}

private boolean is_post_order(int[] nums, int start, int end) {
    if (start >= end) {
        return true;
    }
    int root = nums[end];
    int index = start;
    for (; index < end; index++) {
        if (nums[index] > root) {
            break;
        }
    }
    for (int i = index; i < end; i++) {
        if (nums[i] < root) {
            return false;
        }
    }
    return is_post_order(nums, start, index - 1) && is_post_order(nums, index, end - 1);
}
```

