## 思路

递归的思路，可以看出递归的时间复杂度为 $O(n)$，而且递归的空间复杂度为 $O(n)$。

### Python

```python
class Solution:
    def maxSubArray(self, nums: List[int]) -> int:
        def helper(nums, start, end):
            if start == end:
                return nums[start]
            mid = (start + end) // 2
            left = helper(nums, start, mid)
            right = helper(nums, mid + 1, end)
            cross = helper(nums, start, mid) + helper(nums, mid + 1, end)
            return max(left, right, cross)

        return helper(nums, 0, len(nums) - 1)
```

### C++

```c++
class Solution {
public:
    int maxSubArray(vector<int>& nums) {
        int n = nums.size();
        if (n == 0) return 0;
        int max_sum = nums[0];
        int cur_sum = nums[0];
        for (int i = 1; i < n; ++i) {
            cur_sum = max(cur_sum + nums[i], nums[i]);
            max_sum = max(max_sum, cur_sum);
        }
        return max_sum;
    }
};
```

