private void helper(int[] nums, int k, int index, List<Integer> result) {
    if (index == nums.length) {
        return;
    }
    if (result.size() == k) {
        return;
    }
    result.add(nums[index]);
    helper(nums, k, index + 1, result);
    result.remove(result.size() - 1);
}
