## 解法

### 解法一

解法一的思路是，从后往前遍历，遇到奇数，就把它放到前面，遇到偶数，就把它放到后面。

```java
public void reOrderArray(int [] array) {
    int len = array.length;
    if (len == 0) {
        return;
    }
    int odd = 0;
    int even = len - 1;
    while (odd < even) {
        if (array[odd] % 2 == 1) {
            int temp = array[odd];
            array[odd] = array[even];
            array[even] = temp;
            even--;
        } else {
            odd++;
        }
    }
}
```

### 解法二

解法二的思路是，从前往后遍历，遇到奇数，就把它放到后面，遇到偶数，就把它放到前面。

```java
public void reOrderArray(int [] array) {
    int len = array.length;
    if (len == 0) {
        return;
    }
    int odd = 0;
    int even = len - 1;
